import { Reddit } from "@mui/icons-material";
import React from "react";
import { Routes,Route } from "react-router-dom";
import Home from './Home'

const App=()=>{
    return(
        <>  
            <Routes>
                <Route path="/" element={<Home/>}/>
                <Redirect to='/'></Redirect>
            </Routes>
        </>
    )
}

export default App;
